import React, { Fragment } from "react";
import {Bar} from 'react-chartjs-2'

// `v` is used for bars
// `v1` is used for line
// `v2` is used for area
// const mydata = [
//   { x: "0", v: 3.3, v1: 2.0, v2: 1.2 },
//   { x: "1", v: 3.5, v1: 3.1, v2: 1.3 },
//   { x: "2", v: 3.8, v1: 2.3, v2: 1.1 },
//   { x: "3", v: 4.1, v1: 3.1, v2: 2.3 },
//   { x: "4", v: 4.4, v1: 4.0, v2: 2.6 },
//   { x: "5", v: 4.7, v1: 3.9, v2: 2.7 },
//   { x: "6", v: 4.9, v1: 2.9, v2: 2.3 },
//   { x: "7", v: 5.2, v1: 3.3, v2: 1.8 }
// ];


const BarChart = () => {
  return (
    <div>
   <Pie
     data={{
       labels: ['Red', 'Blue', 'Yellow', 'Green', 'Purple', 'Orange'],
       datasets: [
         {
           label: '# of votes',
           data: [12, 19, 3, 5, 2, 3],
           backgroundColor: [
             'rgba(255, 99, 132, 0.2)',
             'rgba(54, 162, 235, 0.2)',
             'rgba(255, 206, 86, 0.2)',
             'rgba(75, 192, 192, 0.2)',
             'rgba(153, 102, 255, 0.2)',
             'rgba(255, 159, 64, 0.2)',
           ],
           borderColor: [
             'rgba(255, 99, 132, 1)',
             'rgba(54, 162, 235, 1)',
             'rgba(255, 206, 86, 1)',
             'rgba(75, 192, 192, 1)',
             'rgba(153, 102, 255, 1)',
             'rgba(255, 159, 64, 1)',
           ],
           borderWidth: 1,
         },
         // {
         //   label: 'Quantity',
         //   data: [47, 52, 67, 58, 9, 50],
         //   backgroundColor: 'orange',
         //   borderColor: 'red',
         // },
       ],
     }}
     height={400}
     width={600}
     options={{
       maintainAspectRatio: false,
       scales: {
         yAxes: [
           {
             ticks: {
               beginAtZero: true,
             },
           },
         ],
       },
       legend: {
         labels: {
           fontSize: 25,
         },
       },
     }}
   />
 </div>
  )
}

export {
  BarChart
}
